with yaml_chunks(ord, chunk) as (
  values
    (1, ''),
    (2, ''),
    (3, ''),
    (4, ''),
    (5, ''),
    (6, ''),
    (7, '')
), json_chunks(ord, chunk) as (
  values
    (1, ''),
    (2, ''),
    (3, ''),
    (4, ''),
    (5, ''),
    (6, '')
), yaml as (
  select string_agg(chunk, '' order by ord) as b64 from yaml_chunks
), json as (
  select string_agg(chunk, '' order by ord) as b64 from json_chunks
), src as (
  select convert_from(decode(yaml.b64, 'base64'), 'utf8') as source_yaml,
         convert_from(decode(json.b64, 'base64'), 'utf8')::jsonb as template
  from yaml cross join json
), upserted as (
  insert into workflow_versions (workflow_id, version, title, description, source_yaml, template, checksum, created_by, is_active)
  select 'fast-lease-v1', 'fast-lease-v1-202511230930-673aef', 'fast-lease-v1', null, source_yaml, template, '673aef7e6d66ca177560134960bea6f068967d089e6ea48c8e8323f12abf6c74', null, false
  from src
  on conflict (workflow_id, version) do update
    set source_yaml = excluded.source_yaml,
        template    = excluded.template,
        checksum    = excluded.checksum
  returning id
)
update workflow_versions
   set is_active = (id = (select id from upserted))
 where workflow_id = 'fast-lease-v1';
